    observations using CTD, Coulometer for DIC measurement and other instruments from
    the MIRAI in the North Pacific Ocean from 2004-10-13 to 2004-11-08 (NODC Accession
    0112262)",nt"tracking_summary": {ntt"total": 2,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-09-26T20:20:15.346269",nt"name":
    "dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-fro39418",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0112262 includes chemical,
    discrete sample, physical and profile data collected from MIRAI in the North Pacific
    Ocean from 2004-10-13 to 2004-11-08 and retrieved during cruise MR04-06 and PACIFICA_49NZ20041013.
    These data include ALKALINITY, AMMONIUM, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN,
    HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, SALINITY, SILICATE, WATER TEMPERATURE
    and pH. The instruments used to collect these data include CTD, Coulometer for DIC
    measurement and bottle. These data were collected by Makio Honda of Japan Agency
    for Marine-Earth Science and Technology (Jamstec) as part of the PACIFICA_49NZ20041013
    data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
    project for the data synthesis of ocean interior carbon and its related parameters
    in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
    of Carbon and Climate (S-CC) supported the project.",nt"license_title": null,nt"extras":
